import React from "react";

const ParkedVehicles = (props) => {

      console.log(props)

      const {addVehicle, id, freeSpaces} = props;

      return (
            <div>
                  <div className="buttons">
                        <button
                              onClick={(e) =>
                                    addVehicle({
                                          size: 1,
                                          parked: 1,
                                          name: "Motorcycle",
                                          queue: false,
                                          id,
                                    })
                              }
                        >
                              Motorcycle
                        </button>
                        <button
                              onClick={(e) =>
                                    addVehicle({
                                          size: 2,
                                          parked: 2,
                                          name: "Sedan",
                                          queue: false,
                                          id,
                                    })
                              }
                        >
                              Sedan
                        </button>
                        <button
                              onClick={(e) =>
                                    addVehicle({
                                          size: 3,
                                          parked: 3,
                                          name: "Truck",
                                          queue: false,
                                          id,
                                    })
                              }
                        >
                              Truck
                        </button>
                  </div>
                  <div className="freeSpaces">
                        small: {freeSpaces[1]}
                        medium: {freeSpaces[2]}
                        large: {freeSpaces[3]}
                  </div>
            </div>
      );
};

export default ParkedVehicles;
